const data = {
  name: "root",
  isFolder: true,
  items: [
    {
      name: "Folder 1",
      isFolder: true,
      items: [
        {
          name: "Folder 2",
          isFolder: true,
          items: [{ name: "Folder3", isFolder: false }],
        },
      ],
    },
  ],
};

export default data;
